import { useState } from "react"

export const File = ({ style = {}, file, name, deep = 0 }) => {
  const [open, setOpen] = useState(true)

  return <>
    <div
      style={{
        ...style,
        cursor: "pointer",
        marginLeft: deep * 10
      }}
      onClick={() => {
        console.log(name)
      }}
    >
      {name}
      {file.type === `folder` ? <></> : <></>}
    </div>
    {file.type === `folder` && open && <>
      {Object.entries(file).map(([key, value]) => {
        if(key === `type`) {
          return
        }
        return <File
          file={value}
          name={key}
          key={key}
          deep={deep + 1}
        />
      })}
    </>}
  </>
}
